import React, { Component } from 'react';

import ReactVivus from 'react-vivus';
import ball2 from '../SVG/ball2.svg';
import projects from '../SVG/project.svg';



class Landing extends Component {
  render() {
    return (
      <div style={{"width":"100%","height":"100vh","backgroundColor":"#A6C4E0", "textAlign":"center"}}>
      <div style={{"position":"absolute", "margin":"0 auto", "borderColor":"0, 0, 0, 0"}}>
      <ReactVivus
        id="project"
        option={{
          file: projects,
        }}
        style={{ height: '70%%', width: '70%'}}
        callback={console.log}
      />
      </div>
      <ReactVivus
        id="balls"
        option={{
          file: ball2,
          type: 'delayed',
          duration: 150,
        }}
        style={{ height: '130%', width: '104%'}}
        callback={console.log}
      />
      </div>
    )
  }
}

export default Landing;
